import React from 'react';
import Layout from '../utils/layout';
import SignIn from '../components/scenes/Auth/scenes/SignIn/SignIn';

import TestB from '../components/reactnative/TestButton/testB'

const SignInPage = () => (
  <Layout hideNav>
    <SignIn />
    <br />
    <hr />
    <br />
    <TestB />
  </Layout>
);

export default SignInPage;
